// src/components/Tasks.jsx
import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import {
  fetchTasks,
  addTaskAsync,
  updateTaskAsync,
  deleteTaskAsync,
} from '../redux/slices/taskSlice';
import { fetchCategories } from '../redux/slices/categorySlice'; // ðŸ”‘ Import fetchCategories

const Tasks = () => {
  const dispatch = useDispatch();
  const { tasks, loading, error } = useSelector((state) => state.tasks);
  const { categories } = useSelector((state) => state.categories); // ðŸ”‘ Get categories from Redux
  const { token, user } = useSelector((state) => state.auth);

  const [newTaskTitle, setNewTaskTitle] = useState('');
  const [selectedCategory, setSelectedCategory] = useState(''); // ðŸ”‘ Add state for selected category

  useEffect(() => {
    if (token) {
      dispatch(fetchTasks());
      dispatch(fetchCategories()); // ðŸ”‘ Fetch categories
    }
  }, [dispatch, token]);

  const handleAddTask = async () => {
    if (!newTaskTitle.trim()) return;
    if (!selectedCategory) {
      alert('Please select a category.');
      return;
    }
    try {
      await dispatch(addTaskAsync({ title: newTaskTitle, completed: false, categoryId: selectedCategory })).unwrap();
      setNewTaskTitle('');
      setSelectedCategory('');
    } catch (err) {
      console.error('Failed to add task:', err);
    }
  };

  const handleToggleComplete = (task) => {
    dispatch(updateTaskAsync({ ...task, completed: !task.completed }));
  };

  const handleDeleteTask = (id) => {
    dispatch(deleteTaskAsync(id));
  };

  return (
    <div>
      <h2>Tasks</h2>
      {user && <p>Welcome, {user.username} ({user.email})</p>}

      {loading && <p>Loading tasks...</p>}
      {error && <p style={{ color: 'red' }}>Error: {error}</p>}

      <ul style={{ listStyleType: 'none', padding: 0 }}>
        {tasks.length === 0 && !loading && <li>No tasks found.</li>}
        {tasks.map((task) => (
          <li key={task.id} style={{ marginBottom: '0.5rem', display: 'flex', alignItems: 'center' }}>
            <input
              type="checkbox"
              checked={task.completed}
              onChange={() => handleToggleComplete(task)}
              style={{ marginRight: '8px' }}
            />
            <span style={{ flexGrow: 1, textDecoration: task.completed ? 'line-through' : 'none' }}>
              {task.title} {task.categoryId && `(Category ID: ${task.categoryId})`}
            </span>
            <button
              onClick={() => handleDeleteTask(task.id)}
              style={{
                backgroundColor: 'transparent',
                border: 'none',
                color: 'red',
                cursor: 'pointer',
                fontWeight: 'bold',
                marginLeft: '8px',
              }}
              aria-label={`Delete task ${task.title}`}
            >
              &times;
            </button>
          </li>
        ))}
      </ul>

      <div style={{ marginTop: '1rem' }}>
        <input
          type="text"
          placeholder="New task title"
          value={newTaskTitle}
          onChange={(e) => setNewTaskTitle(e.target.value)}
          style={{ padding: '6px', width: '250px' }}
        />
        <select
          value={selectedCategory}
          onChange={(e) => setSelectedCategory(e.target.value)}
          style={{ marginLeft: '8px', padding: '6px' }}
        >
          <option value="">Select Category</option>
          {categories.map((cat) => (
            <option key={cat.id} value={cat.id}>{cat.name}</option>
          ))}
        </select>
        <button onClick={handleAddTask} style={{ marginLeft: '8px', padding: '6px 12px' }}>
          Add Task
        </button>
      </div>
    </div>
  );
};

export default Tasks;
